import React from 'react';

import './App.css';
import {tweets} from '../../constants';
import Tweet from '../../components/Tweet';


const App = () => (

    <div>
        <h1 className="username">{tweets[0].fullname}</h1>
        <img src={tweets[1].avatar}></img>
    </div>

);

export default App;
